import React from "react";
const Card = ({data}) => <>
    <div className="cards">         
    {<img
        src={data.imgsrc}
        alt="Marvel Hero"
    />}
    <p>
        {data.movieName}
        <br />
        <span>{data.releseDate}</span>
    </p>
    <button className="btn">
        <a href={data.link} rel="noreferrer" target="_blank">Watch Now</a></button>
    </div> 
        
</>;

export default Card;
